import React from 'react';
import styled from 'styled-components';
import logo from '../pictures/head.png';

const Styles = styled.div`

background: #eeeeee;
height: 19em;

.Button {
  display: none;
}
img {
  width: 9em;
}

`

function Footer() {
  return (
    <Styles>
      <div>
        <p>Barber Andrew</p>
        <img
          className="d-block p-3"
          src={logo}
          alt="logo"
        />
      </div>
      <div>
      <h3>E-mail:</h3>
            <h2>info@barber-andrew.com</h2>
            <h3>Call now and book your visit!</h3>
            <h2>659 852 666</h2>
            <p>Any Questions ? Fill out the form below and I will get back to you as soon as I can!</p>
      </div>

    </Styles>
  );



}

export default Footer;
